import "./index.sass";
import NavBar from "../components/NavBar"
import LoginPage from "../components/LoginPage"
import WindowLayout from "../components/WindowLayout";

const login = () => alert("hi")

//const Index = () => <WindowLayout/>

const Index = () => <div>
  <NavBar login={login}/>
  <LoginPage/>
</div>

export default Index
